import React from 'react';
import User from '../../components/User';

const authIndexPage = () => (
  <div>
    <h1>The Auth Index Page</h1>
    <User name="Matt" age={80} />
    <p>
      Go to <Link href="auth">Auth</Link>
    </p>
  </div>
);

export default authIndexPage;
